import { useState } from "react";
import { RangeSlider } from "reactrangeslider";

const SliderRange = () => {
  const value = { start: 20, end: 80 };
  const [values, setValue] = useState(0);
    const changeValue = (e) => {
        setValue(e.target.value);
    }
  return <div>
      {values}
  <RangeSlider
    value={ value }
    min={ 20 }
    max={ 100 }
    step={ 5 }
    onChange = {(e) => changeValue(e)}
  />
</div>;
};

export default SliderRange;
